const Character = (props) => {
  return (
    <>
      <img
        className=""
        src={props.character.image}
        alt={`image` + props.character.name}
      />
      <h4>{props.character.name}</h4>
      <h4>{props.character.species}</h4>
      <h4>{props.character.origin.name}</h4>
    </>
  );
};

export default Character;
